"""
392. Is Subsequence

Given two strings s and t, return true if s is a subsequence of t, or false otherwise.

A subsequence of a string is a new string that is formed from the original string by deleting 
some (can be none) of the characters without disturbing the relative positions of the remaining 
characters. (i.e., "ace" is a subsequence of "abcde" while "aec" is not).

Example 1:
    Input: s = "abc", t = "ahbgdc"
    Output: true

Example 2:
    Input: s = "axc", t = "ahbgdc"
    Output: false

 

Constraints:
    0 <= s.length <= 100
    0 <= t.length <= 104
    s and t consist only of lowercase English letters.

 
Follow up: Suppose there are lots of incoming s, say s1, s2, ..., sk where k >= 109, and you want to check 
one by one to see if t has its subsequence. In this scenario, how would you change your code?
"""

##################
# First Approach #
##################
class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        # Easy check first, if s doesn't contain the same characters then we can return False
        if not set(s).issubset(set(t)):
            return False
        
        # Remove characters from t that are not present in s
        set_s = set(s)
        new_t = ""
        for t_char in t:
            if t_char in set_s:
                new_t += t_char
        new_t = "".join(new_t)
        print(s)
        print(new_t)
        # We're missing cases where chracters from s are still in t but messing up the subsequence
        if s in new_t:
            return True
        else:
            return False

# Testcase 1
s = "abc"
t = "ahbgdc"
expected = True
result = Solution().isSubsequence(s, t)
print(f"Result: {result}")
print(f"Expected: {expected}")

